import React from "react";

const App = () => {
  var grating = "";
  var theDate = new Date(2020, 2, 5, 14);
  theDate = theDate.getHours();
  if (theDate >= 1 && theDate < 12) {
    grating = "good morning";
  } else if (theDate >= 12 && theDate < 19) {
    grating = "good afternoon";
  } else {
    grating = "good night";
  }

  return (
    <div>
      <h1>hello ,{grating}</h1>
    </div>
  );
};
export default App;
